import "./main.css";
import NextPage from "./nextPage";
import banner from "../assets/banner-m.jpg";
import lock from "../assets/lock-sm.png";
import { useState } from "react";
function Main() {
    const [check, setcheck] = useState(false)

  return (
    <main>
      <section className="section1">
        <img src={banner} alt="" />
        <div className="boxes">
          <div className="box">
            <p>1-2 კვირა</p>
            <p>2 000 000₾</p>
          </div>
          <div className="box">
            <p>5-8 კვირა</p>
            <p>2 000 000₾</p>
          </div>
          <div className="box">
            <p>
              {" "}
              <img src={lock} alt="" /> 5-8 კვირა
            </p>
            <p>2 000 000₾</p>
          </div>
          <div className="box">
            <p>
              {" "}
              <img src={lock} alt="" /> 5-8 კვირა
            </p>
            <p>2 000 000₾</p>
          </div>
        </div>
      </section>
      <h2>
        12 კვირის განმავლობაში, მიიღე ფულადი პრიზები ყოველკვირეული საპრიზო
        ფონდიდან
      </h2>
      <div className="dates">
        <button onClick={ () => setcheck(true)}>2.07-29.07</button>
      </div>
      <section className="section2">
          {check && <NextPage/>}
      </section>
    </main>
  );
}
export default Main;
